INSERT INTO `v1_7f57c08e34068bb600b4846da57427fd1d5137ca06b593317c642e4115f78e27` VALUES (1, 1, 3, "アサヒ", "", "---", "逆境に屈することなく、部員たちを引っ張る主将。ミート力を活かした安定感のある打撃が持ち味。", 2, 6000, 0);
INSERT INTO `v1_7f57c08e34068bb600b4846da57427fd1d5137ca06b593317c642e4115f78e27` VALUES (3, 1, 0, "部員3", "ホームランを連発すると、連発数に応じてパワーアップする", "アドレナリン", "無愛想だが仲間を大切に想う気持ちは誰よりも強い男。ケンカで鍛えた腕っぷしが自慢のパワーヒッター。", 3, 16000, 3);
INSERT INTO `v1_7f57c08e34068bb600b4846da57427fd1d5137ca06b593317c642e4115f78e27` VALUES (2, 1, 2, "{0}", "幸運のハプニングを呼び込む", "ラッキー", "みんなからの厚い信頼を集める期待の助っ人部員。実力は未知数だが幸運なハプニングを呼び込む。", 4, 30000, 2);
